  constructor() {
    super();
    this.state = {
      name: '',
      roomCode: '',
    };
  }

  render()
  {
    return (
      <section className ="section">
        <div className ="Left">
          <div className ="containerLeft">
            <div className="textField">
              <TextField id="outlined-basic" label="Name" variant="outlined" onChange={setName}/>
            </div>
            <TextField id="outlined-basic" label="Room Code" variant="outlined" onChange={setRoom}/>
